import React, { useState } from 'react';
import { Grid, Image, Segment, Header, Feed } from 'semantic-ui-react';
import MovieInfo from '../HeaderSegement/Explore/MovieInfo';
import vk from "../Images/vk.png";
import got from '../Images/got.png';
import ghost from '../Images/ghost.png';



const HeaderPart = () => {
    const [change, setChange] = useState(vk);

    const Change = () => {
        if (change == vk)
            setChange(ghost)
        else
            setChange(vk)
    }

    return (
        <React.Fragment>
            <Grid columns="2" inverted>
                <Grid.Row textAlign='right'>
                    <Grid.Column width={5}>
                        RGBA colors in css allow you to specify
                        colors with a transparency channel. This is very useful.
                        Consider for example, defining the text states of
                        an element. If the elements color changes, the text
                        might appear more complementary as a shade of black
                        with a portion of the original color. This can be done easily with rgb
                    </Grid.Column>
                    <Grid.Column width={11} className="headerImageBoxShadow">
                        <Image className="headerImage"
                            src={change}
                        />
                        <Feed>
                            <Feed.Event>
                                <Feed.Label>
                                    <img src='https://react.semantic-ui.com/images/avatar/small/elliot.jpg' />
                                </Feed.Label>
                            </Feed.Event>
                        </Feed>
                        <MovieInfo url="https://www.youtube.com/watch?v=3PK2tIyENVA&t=2s" />
                    </Grid.Column>
                </Grid.Row>
            </Grid>
            <button onClick={() => Change()}>
                change
            </button>
        </React.Fragment>
    )
}

export default HeaderPart;
